Meet Friends and Neighbors — the newest @audreysfarmhouse wedding venue and boutique hotel in Stone Ridge, NY. ✨ Located at the foot of the Shawangunk Mountains, this charismatic Hudson Valley venue is less than two hours from NYC.

Though it joins a roster of three other magical Upstate venues by the Audrey’s Farmhouse team, Friends and Neighbors is uniquely charming. Its iconic checkerboard dance floor and vaulted ceilings pair for the perfect dance party inside its grand hall — while intimate and cozy spaces including a Guest Lobby and Bar Room provide respite from the party. A lush meadow, covered courtyard and outdoor area expand the F&N footprint — and on the big night, each of these separate spaces harmonize into one magical venue, ready to host an unforgettable evening.

Listen up, lovebirds! Here’s some key features of note:
 Booking weddings (other events welcome!) now for 2025 and 2026;
✨ Seating for up to 200 guests;
 Keep the party going! Scope their after party options;
 Space for outdoor ceremonies, cocktail hours, and cozying up around a fire;
️ 10 beautiful guest rooms with king size beds, forest views, handmade furnishings and private patios. 

Friends and Neighbors is now accepting bookings for the 2025 and 2026 wedding seasons.  For those on the hunt for a perfect event venue, check out @audreysfarmhouse sister properties as well: The Greenhouses, Old Mill, and Livingston Manor Fly Fishing Club.

—

Find link and wedding info to Friends and Neighbors, plus its sister locations at the link in bio  — or comment “Audrey’s” and we’ll send the link to your DMs! 

Wedding and event inquiries to: hello@audreysfarmhouse.com

Photos/video: photos by @whoajess; video by @joshuabrownphotography

